export const images = {
  category: {
    pasta: require('../assets/photo/pastaIcon.png'), //1
    prodotti: require('../assets/photo/prodottiNew.png'),
    scatola: require('../assets/photo/boxClosed.png'),
    pastaOffset: require('../assets/photo/pastaOffset.png'),
    prodottiOffset: require('../assets/photo/cancel'),
    scatolaOffset: require('../assets/photo/boxOpen.png'),
  },
  otherImages: {
    cartBackgroundHeader: require('../assets/photo/SicilianPattern.png'),
    royaltyBackground: require('../assets/photo/royaltyBackground.jpg'),
    surpriseImage: require('../assets/photo/surprise.png'),
    detailsBackground: require('../assets/photo/SicilianPattern2.jpg'),
  },
}
